import React, { Component } from 'react'

export default class SportIcon extends Component {

    constructor(props) {
        super(props);
    }




    render() {
        return (
            <div class="icon_div">
                <button className={this.props.activeSport===this.props.sport ? 'btn sport_icon selected':'btn sport_icon' } onClick={this.props.changeSport}><img src={`./images/${this.props.sport}.svg`} style={{width:'50px',height:'40px'}}/></button>
            </div>
        )
    }
}
